import styles from "./style.css";
function App() {
  return (
    <nav className={styles.nav}>
      <ul className={styles.nav__list}>
        <li className={styles.nav__btn}>1</li>
        <li className={styles.nav__btn}>2</li>
        <li className={styles.nav__btn}>3</li>
        <li className={styles.nav__btn}>4</li>
      </ul>
      <script
        src="https://kit.fontawesome.com/d41479a0eb.js"
        crossorigin="anonymous"
      ></script>
    </nav>
  );
}

export default App;
